    """
    This function calculates the binomial coefficient "n choose k",
    which represents the number of ways to choose k items from a set of n items without regard to order.
    It uses dynamic programming to efficiently compute the result.
    """
    if k > n:
        return 0
    if k == 0 or k == n:
        return 1
    if k > n // 2:
        k = n - k

    # Initialize a 2D table to store binomial coefficients
    C = [[0 for x in range(k + 1)] for x in range(n + 1)]

    # Fill the table in bottom-up manner
    for i in range(n + 1):
        for j in range(min(i, k) + 1):
            # Base Cases
            if j == 0 or j == i:
                C[i][j] = 1
            # Recursive Case
            else:
                C[i][j] = C[i - 1][j - 1] + C[i - 1][j]

    return C[n][k]
