    For example:
    compute_Last_Digit(6, 12) == 3
    compute_Last_Digit(7, 14) == 0
    compute_Last_Digit(12, 18) == 6
    """
    def last_digit(n):
        if n == 0:
            return 1
        if n == 1:
            return 1
        if n == 2:
            return 2
        if n == 3:
