def is_samepatterns(colors, patterns):
    """
    Given a string colors and a list of strings patterns,
    return True if colors follows the sequence given in patterns.
    For example:
    is_samepatterns("abcabc", ["abc", "abc"]) == True
    is_samepatterns("abcabcabc", ["abc", "abc"]) == False
    """
    if not patterns:
        return True

    pattern = patterns[0]
    for i in range(len(colors) - len(pattern) + 1):
        if colors[i:i+len(pattern)] == pattern:
            if len(patterns) == 1:
                return True
            else:
                if is_samepatterns(colors[i+len(pattern):], patterns[1:]):
                    return True
                else:
                    return False
        else:
            return False
    return False
```

