    a[0][0] = 1

    for i in range(1, n + 1):
        for j in range(m + 1):
            if j == 0:
                a[i][j] = 1
            else:
                a[i][j] = (i - j) * a[i - 1][j - 1] + (j + 1) * a[i - 1][j]

    return a[n][m]
