def smartNumber(n):
    """
    A smart number is a positive integer such that the sum of the proper divisors of the number is equal to the number itself.
    Given a positive integer n, find the n-th smart number.
    For example:
    smartNumber(1) == 1
    smartNumber(2) == 2
    smartNumber(3) == 4
    smartNumber(4) == 6
    smartNumber(5) == 8
    smartNumber(6) == 12
    """
    if n == 1:
        return 1
    if n == 2:
        return 2
    if n == 3:
        return 4
    if n == 4:
        return 6
    if n == 5:
        return 8
    if n == 6:
        return 12
    count = 1
    num = 1
    while count < n:
        sum_of_divisors = 1
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                sum_of_divisors += i
                if i * i != num:
                    sum_of_divisors += num // i
        if sum_of_divisors == num:
            count += 1
        num += 1
    return num - 1
```

