def max_path_sum(tri, m, n):
    """
    Finds the maximum total path sum in the given triangle.

    Args:
        tri: A list of lists representing the triangle.
        m: The number of rows in the triangle.
        n: The number of columns in the triangle.

    Returns:
        The maximum total path sum from the top to the bottom.
    """
    dp = tri[0]
    for i in range(1, m):
        new_dp = [0] * n
        for j in range(n):
            if i == 0:
                new_dp[j] = dp[j]
            elif j == 0:
                new_dp[j] = dp[i - 1][j] + tri[i][j]
            elif j == n - 1:
                new_dp[j] = dp[i - 1][j] + tri[i][j]
            else:
                new_dp[j] = max(dp[i - 1][j], dp[i - 1][j + 1]) + tri[i][j]
        dp = new_dp
    return max(dp)
```

