def does_Contain_B(a, b, c):
    """
    Given three integers a, b, and c, find whether the given number b is present in the infinite sequence starting from a and incrementing by c.
    For example:
    does_Contain_B(2, 6, 3) == True
    does_Contain_B(2, 7, 3) == False
    does_Contain_B(5, 12, 4) == True
    """
    if b == a:
        return True
    if b == a + c:
        return True
    if b < a:
        return False
    if b % c != 0:
        return False
    n = (b - a) // c
    if (b - a) % c == 0 and n >= 0:
        return True
    else:
        return False
```

