def group_keyvalue(l):
    """Given a sequence of key-value pairs, group them into a dictionary of lists.
    For example:
    group_keyvalue([('a', 1), ('b', 2), ('a', 3), ('c', 4), ('b', 5)]) == {'a': [1, 3], 'b': [2, 5], 'c': [4]}
    """
    result = {}
    for key, value in l:
        if key not in result:
            result[key] = [value]
        else:
            result[key].append(value)
    return result
```

