def longest_common_subsequence(X, Y, m, n):
    """
    Finds the longest common subsequence for the given two sequences.

    Args:
        X: The first sequence.
        Y: The second sequence.
        m: The length of the first sequence.
        n: The length of the second sequence.

    Returns:
        The longest common subsequence.
    """

    # Initialize a 2D array to store lengths of common subsequences
    L = [[0 for x in range(n + 1)] for x in range(m + 1)]

    # Iterate through the sequences to populate the array
    for i in range(m + 1):
        for j in range(n + 1):
            if i == 0 or j == 0:
                L[i][j] = 0
            elif X[i - 1] == Y[j - 1]:
                L[i][j] = L[i - 1][j - 1] + 1
            else:
                L[i][j] = max(L[i - 1][j], L[i][j - 1])

    # Backtrack to reconstruct the longest common subsequence
    i = m
    j = n
    LCS = [""] * (m + n)
    while i > 0 and j > 0:
        if X[i - 1] == Y[j - 1]:
            LCS[m + n - 1] = X[i - 1]
            i -= 1
            j -= 1
        else:
            if L[i - 1][j] > L[i][j - 1]:
                i -= 1
            else:
                j -= 1

    return "".join(LCS)
```

