    For example:
    validate(123) == True
    validate(333) == False
    """
    s = str(n)
    freq = {}
    for digit in s:
        if digit in freq:
            freq[digit] += 1
        else:
            freq[digit] = 1
    for digit in freq:
        if freq[digit] > int(digit):
            return False
    return True
