def max_sum_rectangular_grid(grid, n):
    """
    Given a rectangular grid of dimension 2 x n, find out the maximum sum such that no two chosen numbers are adjacent for the given grid.
    For example:
    max_sum_rectangular_grid([[1, 2, 3], [4, 5, 6]], 3) == 12
    max_sum_rectangular_grid([[1, 2, 3], [4, 5, 6]], 4) == 15
    max_sum_rectangular_grid([[1, 2, 3, 4], [5, 6, 7, 8]], 4) == 20
    """
    if n == 0:
        return 0
    elif n == 1:
        return grid[0][0]
    elif n == 2:
        return max(grid[0][0] + grid[1][1], grid[0][1] + grid[1][0])
    else:
        dp = [0] * n
        dp[0] = grid[0][0]
        dp[1] = max(grid[0][0], grid[0][1])
        for i in range(2, n):
            dp[i] = max(dp[i - 1], dp[i - 2] + grid[0][i])
        return dp[n - 1]
```

