def find_Divisor(x, y):
    """
    Finds the maximum occurring divisor in an interval [x, y].

    Args:
        x: The start of the interval (inclusive).
        y: The end of the interval (inclusive).

    Returns:
        The maximum occurring divisor in the interval [x, y].
    """
    if x > y:
        return -1  # Invalid interval

    divisors = {}
    for i in range(x, y + 1):
        for j in range(1, int(i**0.5) + 1):
            if i % j == 0:
                if j in divisors:
                    divisors[j] += 1
                else:
                    divisors[j] = 1
                if i // j != j:
                    if i // j in divisors:
                        divisors[i // j] += 1
                    else:
                        divisors[i // j] = 1

    if not divisors:
        return -1

    max_divisor = max(divisors, key=divisors.get)
    return max_divisor
```

