def find_Divisor(x, y):
    """
    Given two integers x and y, find the maximum occurring divisor in the interval [x, y].
    For example:
    find_Divisor(1, 10) == 1
    find_Divisor(2, 8) == 2
    find_Divisor(3, 9) == 3
    """
    if x == y:
        return x

    count = {}
    for i in range(x, y + 1):
        for j in range(1, int(i**0.5) + 1):
            if i % j == 0:
                if j in count:
                    count[j] += 1
                else:
                    count[j] = 1
                if j * j != i and i // j in count:
                    count[i // j] += 1
