def zigzag(n, k):
    """
    Given two positive integers n and k, find the entringer number e(n, k).
    The entringer number e(n, k) is defined as the number of ways to reach from 1 to n by making k steps.
    Each step can be either up (increase the current number by 1) or down (decrease the current number by 1).
    For example:
    zigzag(3, 2) == 2
    zigzag(4, 2) == 3
    zigzag(5, 3) == 5
    """
    if k == 1:
        return 1
    dp = {}

    def solve(current, steps):
        if steps == 0:
            return 1 if current == n else 0
        if (current, steps) in dp:
            return dp[(current, steps)]
        ans = 0
        if current + 1 <= n:
            ans += solve(current + 1, steps - 1)
        if current - 1 >= 1:
            ans += solve(current - 1, steps - 1)
        dp[(current, steps)] = ans
        return ans

    return solve(1, k)
```

