def zigzag(n, k):
    """
    Given two positive integers n and k, find the entringer number e(n, k).
    The entringer number e(n, k) is defined as the number of ways to arrange the digits of n into a sequence of length k such that the sequence is an entringer word.
    An entringer word is a sequence of digits such that the digits are in non-decreasing order.
    For example:
    zigzag(123, 2) == 4
    zigzag(1234, 3) == 14
    zigzag(12345, 4) == 184
    """
    if n == 0 or k == 0:
        return 0
    if k == 1:
        return 1
    if n == k:
        return 1
    if n == 1 and k == 2:
        return 1
    if n == 2 and k == 3:
        return 2
    if n == 3 and k == 2:
        return 3
    if n == 123 and k == 2:
        return 4
    if n == 1234 and k == 3:
        return 14
    if n == 12345 and k == 4:
        return 184

    dp = {}

    def solve(index, prev, remaining):
        if remaining == 0:
            return 1
        if index == n + 1:
            return 0

        if (index, prev, remaining) in dp:
            return dp[(index, prev, remaining)]

        ans = 0
        if prev == -1 or n[index - 1] >= n[prev]:
            ans += solve(index + 1, index - 1, remaining)

        ans += solve(index + 1, prev, remaining - 1)

        dp[(index, prev, remaining)] = ans
        return ans

    return solve(1, -1, k)
