def find_ways(M):
    """
    Given a set of values M, find the number of sequences of given length
    having non-negative prefix sums that can be generated by given values.
    For example:
    find_ways([1, 2]) == 5
    find_ways([1, 2, 3]) == 21
    """
    n = len(M)
    if n == 0:
        return 0

    dp = {}

    def solve(index, current_sum):
        if index == n:
            if current_sum >= 0:
                return 1
            else:
                return 0

        if (index, current_sum) in dp:
            return dp[(index, current_sum)]

        ways = 0
        for val in M:
            ways += solve(index + 1, current_sum + val)

        dp[(index, current_sum)] = ways
        return ways

    return solve(0, 0)
