def is_tree_balanced(root):
    """
    Check if a binary tree is balanced or not.

    A balanced binary tree is defined as a binary tree in which the depth of the two subtrees of every node never differ by more than 1.

    Args:
        root (Node): The root node of the binary tree.

    Returns:
        bool: True if the binary tree is balanced, False otherwise.
    """

    def get_height(node):
        if not node:
            return 0
        return 1 + max(get_height(node.left), get_height(node.right))

    if not root:
        return True

    left_height = get_height(root.left)
    right_height = get_height(root.right)

    if abs(left_height - right_height) > 1:
        return False

    return is_tree_balanced(root.left) and is_tree_balanced(root.right)
```

