def permute_string(str):
    """
    Given a string, print all permutations of the string including duplicates.
    For example:
    permute_string("aab") == "aab", "aba", "baa"
    permute_string("abc") == "abc", "acb", "bac", "bca", "cab", "cba"
    """
    if len(str) == 0:
        return ""

    perms = []

    def backtrack(current_string, remaining_chars):
        if not remaining_chars:
            perms.append(current_string)
            return

        used = set()
        for i, char in enumerate(remaining_chars):
            if char not in used:
                used.add(char)
                backtrack(current_string + char, remaining_chars[:i] + remaining_chars[i+1:])

    backtrack("", list(str))

    return ", ".join(perms)
```

