def round_num(n, m):
    """
    Rounds the given number to the nearest multiple of a specific number.

    Args:
      n: The number to round.
      m: The multiple to round to.

    Returns:
      The rounded number.
    """
    result = (n + m / 2)
    if result % m == 0:
        return int(result)
    elif result < n:
        return int(result)
    else:
        return int(result + (m - (result % m)))
```

