    sum_even_factors = 0
    for i in range(1, int(n**0.5) + 1):
        if n % i == 0:
            if i % 2 == 0:
                sum_even_factors += i
            if (n // i) % 2 == 0 and i * i != n:
                sum_even_factors += n // i
    return sum_even_factors
