def add_pairwise(test_tup):
    """Given a tuple of tuples, find the pairwise addition of the elements of the given tuples.
    For example:
    add_pairwise((1, 2), (3, 4)) == (4, 6)
    add_pairwise((1, 2, 3), (4, 5, 6), (7, 8, 9)) == (5, 7, 9)
    """
    if not test_tup:
        return ()

    result = []
    for i in range(len(test_tup)):
        for j in range(i + 1, len(test_tup)):
            result.append(test_tup[i] + test_tup[j])
    return tuple(result)
